    false,nt"url": null,nt"notes": "Storage and Retrieval for Water Quality
    Data (STORET and the Water Quality Exchange, WQX) defines the methods and the data
    systems by which EPA compiles monitoring data (typically water quality data, but
    not exclusively water quality data) that are collected by a number of entities.
    This dataset represents the monitoring locations contained within the STORET Data
    Warehouse, or put another way, the point locations of where data providers to the
    STORET Data Warehouse have performed water monitoring activities such as water sampling
    or taking field measurements. The dataset's locations are based on the latitude
    and longitude that the source data owner submitted to the STORET Data Warehouse.
    EPA has not performed Quality Assurance as to the accuracy of the latitudes and
    longitudes; this dataset provides the locations based on the data provided by the
    data owner.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
